import React from 'react';
import logo from '../images/appLogo.png'


export default function Header(props) {
    return (
        <>
            <header className="col-12 header">
                <div className="insideHeader">
                    <img src={logo} alt="" />
                </div>
            </header>
        </>
    );
}
